import React from "react";
import "../Lounge/Lounge.scss";
import Connect from "../../assets/images/connect-wallet.png";
import Disconnect from "../../assets/images/logout-wallet.png";
import { useMoralis } from "react-moralis";

const LogoutButton = () => {
  const { logout } = useMoralis();

  return (
    <img
      src={Disconnect}
      className="connect-bttn"
      alt="signing-off"
      onClick={() => logout()}
    />
  );
};

function Lounge() {
  const { authenticate, authError, isAuthenticating } = useMoralis();
  return (
    <div>
      {authError && (
        <p className="access-failure">requested signature was not completed.</p>
      )}
      {isAuthenticating && <p className="access-failure">loading</p>}
      <img
        src={Connect}
        className="connect-bttn"
        alt="Connect-Wallet"
        onClick={() =>
          authenticate({
            signingMessage:
              "You are at the right place! Welcome to the Space Bar Lounge! Verify your tokens",
          })
        }
      />
      <div className="lounge">
        <p className="lounge__info">I am Lounge</p>
      </div>
    </div>
  );

  const { isAuthenticated, user } = useMoralis({
    address: "0x495f947276749ce646f68ac8c248420045cb7b5e",
  });

  return (
    <div>
      {isAuthenticated && <p className="access-failure">yes</p>}
      <LogoutButton />
      <h1>Welcome {user.get("username")}, to the Space Bar Lounge!</h1>
    </div>
  );
}

export default Lounge;
